import React, {Component} from "react";
import Card from "../Card/Card";
import "./estilos.css";


class Baralho extends Component{

    constructor(props){
        super(props);
        
    }

   
           
    render(){
        console.log('props no Baralho',this.props)
        if(this.props.length = 0){
            return 'oi'
        }
        else{
            return (
            
                <ul>
                
                    {this.props.cartas.map((cartas,index)=>{
                        return(
                            <li id={'bar'+index}>
                           
                                <Card 
                                
                                  id={cartas.id}
                                  país={cartas.país} idh={cartas.idh} exp={cartas.exp}/>
                            </li>
                        )
                    })}
                    
                </ul>
                   
               
              
               ); 
        }
        
    }
   
}

export default Baralho;

